import React, { useState } from 'react';

const Item = (props) => {
  const [status, setStatus] = useState(false);

  return (
      <li
        key={props.key}
        id={props.id}
        onClick={() => setStatus(!status)}
        style={{textDecorationLine: status ? 'line-through' : 'none'}}
      >
        {props.value}
      </li>
  );
};

export default Item;
